FeedPackage.ReleaseNotes:
update native lib to v1.10 (Released May 10, 2017)
General
All Platform: Enhanced the image quality under complex network quality and device environment;
All Platform: Fixed some crashes;
All Platform(except for Web): added the function of enabling and disabling the co-existence of the SDK and other APPs audio. For details, contact sales-us@agora.io if required.
origin: https://docs.agora.io/en/user_guide/communication/Agora_Native_SDK_Release_Notes.html

